import React from 'react';
import './LandingHeader.css'

const LandingHeader = () => {
    return(
      <header className='landingheader'>
        <div className='contents'>
          <h2 className='title'>
            <hr size="5px" width="200px"></hr>
              주소: 서울시립대 정보기술관 205호 <br/>TEL: 010-2060-7486
          </h2>
        </div>
      </header>
  
    )
  }
  
  export default LandingHeader;
